  `total_fee` int(11) NULL DEFAULT NULL COMMENT '标价金额',
  `spbill_create_ip` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '终端IP',
