INSERT INTO `eb_article` VALUES (2, '601', 'CRMEB通过将CRM（客户关系管理）+EB（营销电商）提供深度结合，致力于为开发者提供全渠道多场景的高性能电商系统软件服务；40w+开发者的选择与信任，值得托付！', 'CRMEB', 'crmebimage/public/product/2025/05/30/d0cbc3eda6ce456b974385d1672b88695niva5d35z.png', 'CRMEB通过将CRM（客户关系管理）+EB（营销电商）提供深度结合，致力于为开发者提供全渠道多场景的高性能电商系统软件服务；40w+开发者的选择与信任，值得托付！', 'CRMEB通过将CRM（客户关系管理）+EB（营销电商）提供深度结合，致力于为开发者提供全渠道多场景的高性能电商系统软件服务；40w+开发者的选择与信任，值得托付！', 'CRMEB通过将CRM（客户关系管理）+EB（营销电商）提供深度结合，致力于为开发者提供全渠道多场景的高性能电商系统软件服务；40w+开发者的选择与信任，值得托付！', '12', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<p>CRMEB通过将CRM（客户关系管理）+EB（营销电商）提供深度结合，致力于为开发者提供全渠道多场景的高性能电商系统软件服务；40w+开发者的选择与信任，值得托付！</p>', '2024-07-04 10:43:03', '2025-06-24 11:07:38');
INSERT INTO `eb_article` VALUES (3, '807', '一切为了开发者！倾力打造全行业超高性价比电商系统；节省开发时间，减少重复造轮子，提升开发效率；助力企业实现数字化经营！', '哈哈', 'crmebimage/public/product/2025/05/30/cc4fc41036074c7197c0a52b28b6ff2c1wspff21tk.png', '一切为了开发者！倾力打造全行业超高性价比电商系统；节省开发时间，减少重复造轮子，提升开发效率；助力企业实现数字化经营！', '一切为了开发者！倾力打造全行业超高性价比电商系统；节省开发时间，减少重复造轮子，提升开发效率；助力企业实现数字化经营！', '一切为了开发者！倾力打造全行业超高性价比电商系统；节省开发时间，减少重复造轮子，提升开发效率；助力企业实现数字化经营！', '13', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<p>一切为了开发者！倾力打造全行业超高性价比电商系统；节省开发时间，减少重复造轮子，提升开发效率；助力企业实现数字化经营！</p>', '2024-07-04 10:44:17', '2025-05-30 15:23:47');
INSERT INTO `eb_article` VALUES (5, '601', '以消费者为中心构建社群营销模式，重构品牌与消费者的关系，从供需关系向社群化关系转变，社交赋能新零售竞争优势，结合企业业务架构进行全渠道内容升级，实现社交电商、私域运营等数字化管理经营。将用户转化为品牌', '测一下diy', 'crmebimage/public/product/2025/05/30/c2682e7e42374ab6961be9697cd512fdv4xjfnzaoo.png', '以消费者为中心构建社群营销模式，重构品牌与消费者的关系，从供需关系向社群化关系转变，社交赋能新零售竞争优势，结合企业业务架构进行全渠道内容升级，实现社交电商、私域运营等数字化管理经营。将用户转化为品牌', '以消费者为中心构建社群营销模式，重构品牌与消费者的关系，从供需关系向社群化关系转变，社交赋能新零售竞争优势，结合企业业务架构进行全渠道内容升级，实现社交电商、私域运营等数字化管理经营。将用户转化为品牌', '以消费者为中心构建社群营销模式，重构品牌与消费者的关系，从供需关系向社群化关系转变，社交赋能新零售竞争优势，结合企业业务架构进行全渠道内容升级，实现社交电商、私域运营等数字化管理经营。将用户转化为品牌', '11', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<p>以消费者为中心构建社群营销模式，重构品牌与消费者的关系，从供需关系向社群化关系转变，社交赋能新零售竞争优势，结合企业业务架构进行全渠道内容升级，实现社交电商、私域运营等数字化管理经营。将用户转化为品牌资产，提升零售效率。</p>', '2024-07-04 10:46:45', '2025-05-30 15:19:02');
INSERT INTO `eb_article` VALUES (6, '807', '企业内购商城运营方案--系统搭建', 'HiShop海商', 'crmebimage/public/store/2025/05/30/7b3d97d7821a40f7bb618bd8dd9189ea0lubmy29hs.png', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '企业内购商城运营方案--系统搭建', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '6', 0, '', NULL, 0, 0, 0, 0, 0, 1, 1, '<div class=\"dpu8C _2kCxD \">\n<p><strong>企业内购商城运营方案</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　一、系统搭建</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 需求分析：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　了解企业内部员工的采购需求和习惯，确定内购商城的主要功能和目标。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　进行市场调研，选择适合的技术平台和合作供应商。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　2. 平台选择与搭建：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　选择稳定、安全且功能完善的电商平台作为技术基础。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　搭建前端展示页面和后台管理系统，确保系统具备良好的扩展性和兼容性。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　与企业内部系统(如OA系统、ERP系统)进行集成，确保数据同步和流程无缝对接。</p>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp; 3. 系统配置与安全：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　配置用户权限、商品分类、支付方式、物流接口等基础设置。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　确保系统的安全性，采用数据加密、用户认证等措施保护用户隐私和交易安全。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　二、供应商管理</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 供应商筛选：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　筛选优质供应商，确保商品质量和供应的稳定性。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　签订合作协议，明确双方的权利和义务。</p>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp; 2. 商品管理：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　供应商上传商品信息，包括商品名称、规格、价格、库存等。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　进行商品分类管理，确保商品信息的准确和及时更新。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　3. 库存管理：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　实时监控商品库存，确保供应链的稳定性。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　进行库存预警，及时补充缺货商品，避免因缺货导致的采购延误。</p>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;三、用户体验优化</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 界面设计：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　界面设计应简洁友好，操作便捷，提供良好的用户体验。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　根据不同用户群体(如企业员工、采购负责人等)的需求，定制化设计功能模块。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　2. 个性化推荐：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　通过分析员工的采购历史和偏好，提供个性化推荐，提高购物体验和满意度。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　3. 快捷支付：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　提供多种便捷支付方式，如企业预付账户、信用支付等，简化支付流程，提高支付效率。</p>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;4. 售后服务：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　提供完善的售后服务，包括退换货政策、售后客服支持等，确保员工购物无后顾之忧。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　四、营销活动策划</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 用户分层：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　根据员工的职位等级和会员等级，制定差异化的营销策略和优惠政策。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　2. 定期活动：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　限时抢购： 每月推出几次限时抢购活动，活动期间内，指定商品以超低价格出售。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　积分兑换： 员工购物后可累计积分，积分可在积分商城中兑换各种礼品或下次购物时抵扣。</p>\n<div class=\"dpu8C _2kCxD \">\n<p>会员专享日： 每月设立一个会员专享日，会员可在当天享受特别优惠，如全场额外9折。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　节日特惠： 在重要节假日(如春节、国庆节)推出特惠活动，提供全场折扣、满减优惠、礼品赠送等。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　员工内购节： 每年举办一次大型员工内购节，期间全场商品享受大幅折扣，设置多种互动活动和抽奖环节。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　五、数据分析与反馈</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 数据收集与分析：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　系统自动收集采购数据、用户行为数据、库存数据等。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　进行数据分析，生成报表，帮助企业了解采购趋势和员工的购物行为。</p>\n</div>\n<div class=\"_3hMwG _2kCxD \">\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;2. 用户反馈机制：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　定期收集员工的意见和建议，及时改进平台功能和服务。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　通过用户反馈，不断优化用户体验，提高用户满意度。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　六、持续改进与优化</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 培训与宣传：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　为员工提供内购系统的使用培训，帮助他们熟悉系统操作，提高使用率和购物体验。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　利用企业内部通讯工具、宣传材料等多种方式推广内购系统，让更多员工了解并使用平台。</p>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp; 2. 系统维护与升级：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　定期进行系统维护，确保系统的稳定性和安全性。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　根据用户反馈和市场需求，不断升级和优化系统功能，提高平台的竞争力。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　3. 供应链优化：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　优化供应链管理，提高商品的供应速度和服务质量。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　与更多优质供应商建立合作关系，丰富商品种类和库存。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　七、用户运营</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 会员管理：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　设立会员等级制度，根据会员的购物频率和消费金额，给予不同的优惠和福利。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　定期进行会员回访，了解会员需求和建议，提高会员满意度。</p>\n</div>\n</div>\n<div class=\"_3hMwG _2kCxD \">\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;2. 活动推广：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　通过邮件、短信、企业内部公告等方式推广各类营销活动，吸引员工参与。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　根据活动效果进行分析，不断优化活动策划和执行，提高活动的吸引力和转化率。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　3. 社群运营：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　建立员工社群，通过社群互动增强员工的归属感和参与感。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　定期在社群中发布优惠信息和活动预告，增加员工对平台的黏性。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　企业内购商城的运营方案涵盖了系统搭建、供应商管理、用户体验优化、营销活动策划、数据分析与反馈、持续改进与优化及用户运营等多个方面。通过精心策划和执行各个环节的运营流程，确保内购商城的高效运行和持续发展，为企业和员工创造更多价值。</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', '2024-11-08 10:01:33', '2025-06-24 11:07:46');
INSERT INTO `eb_article` VALUES (7, '601', '企业内购商城运营方案--供应商管理', 'HiShop海商', 'crmebimage/public/product/2025/05/30/7f7d5ad66d38491ca8c636aa0978b31d01xqrmrd88.png', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '企业内购商城运营方案--供应商管理', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '0', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;二、供应商管理</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 供应商筛选：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　筛选优质供应商，确保商品质量和供应的稳定性。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　签订合作协议，明确双方的权利和义务。</p>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp; 2. 商品管理：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　供应商上传商品信息，包括商品名称、规格、价格、库存等。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　进行商品分类管理，确保商品信息的准确和及时更新。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　3. 库存管理：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　实时监控商品库存，确保供应链的稳定性。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　进行库存预警，及时补充缺货商品，避免因缺货导致的采购延误。</p>\n</div>\n</div>', '2024-11-08 10:04:33', '2025-05-30 15:17:35');
INSERT INTO `eb_article` VALUES (8, '601', '企业内购商城运营方案--用户体验优化', 'HiShop海商', 'crmebimage/public/product/2025/05/30/9b5571c16a4a47bb95cc1af5b2f09e21xf7nsub0uc.png', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '企业内购商城运营方案--用户体验优化', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '0', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;三、用户体验优化</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 界面设计：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　界面设计应简洁友好，操作便捷，提供良好的用户体验。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　根据不同用户群体(如企业员工、采购负责人等)的需求，定制化设计功能模块。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　2. 个性化推荐：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　通过分析员工的采购历史和偏好，提供个性化推荐，提高购物体验和满意度。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　3. 快捷支付：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　提供多种便捷支付方式，如企业预付账户、信用支付等，简化支付流程，提高支付效率。</p>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;4. 售后服务：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　提供完善的售后服务，包括退换货政策、售后客服支持等，确保员工购物无后顾之忧。</p>\n</div>\n</div>', '2024-11-08 10:05:46', '2025-05-30 15:17:56');
INSERT INTO `eb_article` VALUES (9, '807', '企业内购商城运营方案--营销活动策划', 'HiShop海商', 'crmebimage/public/content/2025/05/30/31605878bf6e4ebdb7b6598abfd3ffefovpec6v6b1.png', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '企业内购商城运营方案--营销活动策划', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '4', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;四、营销活动策划</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 用户分层：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　根据员工的职位等级和会员等级，制定差异化的营销策略和优惠政策。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　2. 定期活动：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　限时抢购： 每月推出几次限时抢购活动，活动期间内，指定商品以超低价格出售。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　积分兑换： 员工购物后可累计积分，积分可在积分商城中兑换各种礼品或下次购物时抵扣。</p>\n<div class=\"dpu8C _2kCxD \">\n<p>会员专享日： 每月设立一个会员专享日，会员可在当天享受特别优惠，如全场额外9折。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　节日特惠： 在重要节假日(如春节、国庆节)推出特惠活动，提供全场折扣、满减优惠、礼品赠送等。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　员工内购节： 每年举办一次大型员工内购节，期间全场商品享受大幅折扣，设置多种互动活动和抽奖环节。</p>\n</div>\n</div>', '2024-11-08 10:06:36', '2025-05-30 15:20:32');
INSERT INTO `eb_article` VALUES (10, '807', '企业内购商城运营方案--数据分析与反馈', 'HiShop海商', 'crmebimage/public/product/2025/05/30/d198aa04ae7446d58343396e11f08ab9ce0130oepf.png', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '企业内购商城运营方案--数据分析与反馈', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '6', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;五、数据分析与反馈</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 数据收集与分析：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　系统自动收集采购数据、用户行为数据、库存数据等。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　进行数据分析，生成报表，帮助企业了解采购趋势和员工的购物行为。</p>\n</div>\n<div class=\"_3hMwG _2kCxD \">\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;2. 用户反馈机制：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　定期收集员工的意见和建议，及时改进平台功能和服务。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　通过用户反馈，不断优化用户体验，提高用户满意度。</p>\n</div>\n</div>', '2024-11-08 10:07:25', '2025-05-30 15:11:56');
INSERT INTO `eb_article` VALUES (12, '807', '企业内购商城运营方案--用户运营', 'HiShop海商', 'crmebimage/public/product/2025/05/30/32dce0ca9e2149619683d501392322465setzh6arg.png', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '企业内购商城运营方案--用户运营', '企业内购商城的运营方案需要从系统搭建、供应商管理、用户体验优化、营销活动策划到数据分析和持续改进等多个方面进行详细规划。以下是一份详细的企业内购商城运营方案，帮助企业高效管理和运行内购商城。', '8', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<div class=\"dpu8C _2kCxD \">\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;七、用户运营</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　1. 会员管理：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　设立会员等级制度，根据会员的购物频率和消费金额，给予不同的优惠和福利。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　定期进行会员回访，了解会员需求和建议，提高会员满意度。</p>\n</div>\n</div>\n<div class=\"_3hMwG _2kCxD \">\n<div class=\"dpu8C _2kCxD \">\n<p><strong>&nbsp; &nbsp; &nbsp;2. 活动推广：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　通过邮件、短信、企业内部公告等方式推广各类营销活动，吸引员工参与。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　根据活动效果进行分析，不断优化活动策划和执行，提高活动的吸引力和转化率。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p><strong>　　3. 社群运营：</strong></p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　建立员工社群，通过社群互动增强员工的归属感和参与感。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　定期在社群中发布优惠信息和活动预告，增加员工对平台的黏性。</p>\n</div>\n<div class=\"dpu8C _2kCxD \">\n<p>　　企业内购商城的运营方案涵盖了系统搭建、供应商管理、用户体验优化、营销活动策划、数据分析与反馈、持续改进与优化及用户运营等多个方面。通过精心策划和执行各个环节的运营流程，确保内购商城的高效运行和持续发展，为企业和员工创造更多价值。</p>\n</div>\n</div>', '2024-11-08 10:08:57', '2025-05-30 15:11:36');
INSERT INTO `eb_article` VALUES (14, '807', '更换WxJava设置修改说明', 'crmeb-怪兽的猫', 'crmebimage/public/product/2025/05/30/ff23ee4316954967b8c3cfc1c42da81co5bdt90m0p.jpg', '在Crmeb-Java多商户V1.9版本中，我们将微信相关的所有内容，切换为使用WxJava框架实现。', '更换WxJava设置修改说明', '在Crmeb-Java多商户V1.9版本中，我们将微信相关的所有内容，切换为使用WxJava框架实现。', '0', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<p>在Crmeb-Java多商户V1.9版本中，我们将微信相关的所有内容，切换为使用WxJava框架实现。</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在这里，从小程序、公众号、app等方面针对前后版本间设置的不同方式做逐一说明</p>\n<p>首先来看页面上的变化：</p>\n<p>小程序：</p>\n<p>平台端设置&mdash;平台设置&mdash;应用配置&mdash;小程序配置</p>\n<p>参数删除</p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/75499206fe6b443fb1359a393694e646ig6q9at6eb.png\" /></p>\n<p>平台端设置&mdash;平台设置&mdash;支付/充值&mdash;小程序支付配置</p>\n<p>表单去除</p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/f1020b1750374ede90b3400c0915111fonsq4otadu.png\" /></p>\n<p>公众号：</p>\n<p>平台端设置&mdash;平台设置&mdash;应用配置&mdash;公众号配置</p>\n<p>参数删除</p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/68a5f682fbef4b7da5f94baae02124c245e6fimek4.png\" /></p>\n<p>平台端设置&mdash;平台设置&mdash;支付/充值&mdash;公众号支付配置</p>\n<p>表单去除</p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/a0755372e4eb4bb5b5da3948506c95222e6n3uk8d0.png\" /></p>\n<p>微信app：</p>\n<p>平台端设置&mdash;平台设置&mdash;应用配置&mdash;微信APP配置</p>\n<p>表单删除</p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/8b9baf81e9da484a8cfe1f7c16e99644a9j8pfj4hb.png\" /></p>\n<p>平台端设置&mdash;平台设置&mdash;支付/充值&mdash;微信APP支付</p>\n<p>表单去除</p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/657d0692425b47708f9c97aa097446deuf32qnol9f.png\" /></p>\n<p>&nbsp;</p>\n<p>上边看到，微信在页面上的参数配置基本都被删除掉了</p>\n<p>现在这部分的配置被转移到Java代码的配置文件（application.yml）中。</p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/c73aeaff4cd34ff69879fd70feaa69880ja0m9aqqu.png\" /></p>\n<p>下边打开一个application.yml对里边的参数做详细说明</p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/288392afa81e44029c28f59cc4ffa02dvjlowzpzz2.png\" /></p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/4bad34e8a93d447189f58b2636db382b63cmldn0ym.png\" /></p>\n<p><img src=\"https://crmebjavamer.oss-cn-beijing.aliyuncs.com/crmebimage/public/product/2025/05/30/abfdabbe681b404e8287d3279eff86cfl2698hqj4o.png\" /></p>\n<p>wx:<br /> &nbsp; miniapp:#小程序配置<br /> &nbsp;&nbsp;&nbsp; useRedis: true #是否使用redis存储<br /> &nbsp;&nbsp;&nbsp; redisConfig:<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; host: <em>#redis</em><em>地址<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>port: 6379 <em>#</em><em>端口<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>password: #redis密码<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; timeout: 30000 <em># </em><em>连接超时时间（毫秒）<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>database: 13&nbsp; <em>#</em><em>默认数据库<br /> &nbsp;&nbsp;&nbsp; </em>configs:<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - appid: <em>#</em><em>微信小程序的appid<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>secret: <em>#</em><em>微信小程序的Secret<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>token: <em>#</em><em>微信小程序消息服务器配置的token<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>aesKey: <em>#</em><em>微信小程序消息服务器配置的EncodingAESKey<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>msgDataFormat: JSON<br /> &nbsp; mp:#公众号配置<br /> &nbsp;&nbsp;&nbsp; useRedis: true#是否使用redis存储<br /> &nbsp;&nbsp;&nbsp; redisConfig:<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; host: <em>#redis</em><em>地址<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>port: 6379 <em>#</em><em>端口<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>password: #redis密码<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; timeout: 30000 <em># </em><em>连接超时时间（毫秒）<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>database: 13&nbsp; <em>#</em><em>默认数据库<br /> &nbsp;&nbsp;&nbsp; </em>configs:<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - appid: <em>#</em><em>微信公众号的appid<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>secret: <em>#</em><em>微信公众号的Secret<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>token: <em>#</em><em>微信公众号消息服务器配置的token<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>aesKey: <em>#</em><em>微信公众号消息服务器配置的EncodingAESKey<br /> &nbsp; </em>open:#开放平台配置（这里是网页应用，PC扫码使用）<br /> &nbsp;&nbsp;&nbsp; useRedis: true#是否使用redis存储<br /> &nbsp;&nbsp;&nbsp; componentAppId: <em>#</em><em>微信</em>开放平台<em>的appid</em><br /> &nbsp;&nbsp;&nbsp; componentSecret: <em>#</em><em>微信</em>开放平台<em>的Secret</em><br /> &nbsp;&nbsp;&nbsp; componentToken: <em>#</em><em>微信</em>开放平台<em>消息服务器配置的token</em><br /> &nbsp;&nbsp;&nbsp; componentAesKey: <em>#</em><em>微信</em>开放平台<em>消息服务器配置的EncodingAESKey</em><br /> &nbsp;&nbsp;&nbsp; redisConfig:<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; host: <em>#</em><em>地址<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>port: <em>#</em><em>端口<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>password:</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; timeout: 30000 <em># </em><em>连接超时时间（毫秒）<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>database: 13&nbsp; <em>#</em><em>默认数据库<br /> &nbsp; </em>pay:<br /> &nbsp;&nbsp;&nbsp; mp: <em>#</em><em>微信公众号支付<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>appId: <em>#</em><em>微信公众号的appid<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>mchId: <em>#</em><em>微信支付商户号<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>mchKey: UEDB04iYzYJ6o2AhMGkxPN7r27lEp4gq <em>#</em><em>微信支付商户密钥<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #&nbsp;&nbsp;&nbsp; subAppId: #服务商模式下的子商户公众账号ID<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #&nbsp;&nbsp;&nbsp; subMchId: #服务商模式下的子商户号<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>keyPath: <em># p12</em><em>证书的位置，可以指定绝对路径，也可以指定类路径（以classpath:开头）<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>apiV3Key: <em># apiV3 </em><em>秘钥值 (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>certSerialNo: <em># apiV3 </em><em>证书序列号值 (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>privateCertPath: <em># apiclient_cert.pem</em><em>证书文件的绝对路径或者以classpath:开头的类路径. (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>privateKeyPath: <em># apiclient_key.pem</em><em>证书文件的绝对路径或者以classpath:开头的类路径. (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>publicKeyPath: <em># </em><em>微信支付公钥，pub_key.pem证书文件的绝对路径或者以classpath:开头的类路径. (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>publicKeyId: <em># </em><em>微信支付公钥ID (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp; </em>ma: <em>#</em><em>微信小程序<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>appId: <em>#</em><em>微信小程序的appid<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>mchId: <em>#</em><em>微信支付商户号<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>mchKey: <em>#</em><em>微信支付商户密钥<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #&nbsp;&nbsp;&nbsp; subAppId: #服务商模式下的子商户公众账号ID<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #&nbsp;&nbsp;&nbsp; subMchId: #服务商模式下的子商户号<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>keyPath: <em># p12</em><em>证书的位置，可以指定绝对路径，也可以指定类路径（以classpath:开头）<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>apiV3Key: <em># apiV3 </em><em>秘钥值 (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>certSerialNo: <em># apiV3 </em><em>证书序列号值 (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>privateCertPath:<em>证书文件的绝对路径或者以classpath:开头的类路径. (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>privateKeyPath: <em># apiclient_key.pem</em><em>证书文件的绝对路径或者以classpath:开头的类路径. (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>publicKeyPath: <em># </em><em>微信支付公钥，pub_key.pem证书文件的绝对路径或者以classpath:开头的类路径. (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>publicKeyId: <em># </em><em>微信支付公钥ID (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp; </em>app: <em>#</em><em>微信APP<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>appId: <em>#</em><em>微信小程序的appid<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>mchId: <em>#</em><em>微信支付商户号<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>mchKey: <em>#</em><em>微信支付商户密钥<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #&nbsp;&nbsp;&nbsp; subAppId: #服务商模式下的子商户公众账号ID<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #&nbsp;&nbsp;&nbsp; subMchId: #服务商模式下的子商户号<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>keyPath: <em># p12</em><em>证书的位置，可以指定绝对路径，也可以指定类路径（以classpath:开头）<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>apiV3Key: <em># apiV3 </em><em>秘钥值 (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>certSerialNo: <em># apiV3 </em><em>证书序列号值 (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>privateCertPath: <em># apiclient_cert.pem</em><em>证书文件的绝对路径或者以classpath:开头的类路径. (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>privateKeyPath: <em># apiclient_key.pem</em><em>证书文件的绝对路径或者以classpath:开头的类路径. (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>publicKeyPath: <em># </em><em>微信支付公钥，pub_key.pem证书文件的绝对路径或者以classpath:开头的类路径. (V3商户模式需要)<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em>publicKeyId: <em># </em><em>微信支付公钥ID (V3商户模式需要)</em></p>', '2025-05-30 15:16:59', '2025-05-30 15:16:59');
INSERT INTO `eb_article` VALUES (15, '601', '好物推荐', 'crmeb', 'crmebimage/public/content/2025/05/30/f445c2913ade47c59ec8141fe49e57bcus892ib3ld.png', '设计师的心思', '好物推荐', '设计师的心思', '0', 0, '', NULL, 0, 0, 0, 0, 0, 0, 0, '<p>这款包包以其独特的设计和高级材质，展现出非凡的魅力，让人一眼难忘&zwnj;，每个细节都透露着设计师的心思，展现出佩戴者的独特品味和优雅气质&zwnj;，不仅提升造型，更彰显你的品味，是日常出行的最佳选择&zwnj;，这款包包以其简约的设计和流畅的线条，瞬间提升整体格调，适合各种场合&zwnj;，小巧的体型不仅方便携带，还能在细节中展现你的时尚品味&zwnj;，选择一款心仪的包包，就像选择一个陪伴你走过风雨的朋友，它不仅是一个配饰，更是你的情感寄托。</p>', '2025-05-30 15:23:20', '2025-05-30 15:23:20');
